import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles({
    root: {
      width: 500,
    },
    title:{
        textAlign:'center'
    },
    date: {
        fontSize:'1rem',
        margin:'2rem'
    }
  });

function ShowChecking() {
    const classes = useStyles();
    const [blockList,setBlockList] = useState([]);

    useEffect(() => {
        axios.get('/showFormCheck')
        .then(res => setBlockList(res.data))
        .catch(err => console.log(err))
    },[]);


    return (
        <div>
            <h1 className={classes.title}>Список Блоков</h1>
                {blockList.map(el => 
                    <div>
                        <span className={classes.date}>{el.date}</span>
                        <Button variant='contained' color='primary'>Показать График</Button>
                    </div>
                )}
        </div>
    )
}

export default ShowChecking;
